FixAndLoadPoncotPicWithTilemap:: ; 65db (1:65db)
; hl - VTile coordinate for Poncot pic loading
; de - Address where the decompressed Poncot pic lives
; bc - Size of pic (only used if fixing alignment, see below)
; [wPoncotPicAlignment] - If nonzero, don't fix alignment.
;                         Otherwise, if loading the enemy
;                         pic into $8cc0, reverse its
;                         facing.
	ld a, [wPoncotPicAlignment]
	or a
	jr nz, .next
	ld a, h
	cp $89 ; monster gfx are loaded into VRAM at either $89b0 or $8cc0.
	jr z, .next
	push de
	push hl
	push bc
	ld l, e
	ld h, d
.loop
	ld a, [hl]
REPT 8
	rrca
	rl e
ENDR
	ld [hl], e
	inc hl
	dec bc
	ld a, c
	or b
	jr nz, .loop
	pop bc
	pop hl
	pop de
.next
	push de
	push hl
	call RequestVideoData
	pop hl
	pop de
	push hl
	ld a, h
	ld c, $9b
	cp $89
	jr z, .got_tile_start
	ld c, $cc
.got_tile_start
	ld hl, -$40
	add hl, de
	push hl
	ld b, $40
.copy_tilemap
	ld a, [hl]
	or a
	jr z, .next_tile
	ld a, $8f
	jr .load

.next_tile
	ld a, c
	inc c
.load
	ld [hli], a
	dec b
	jr nz, .copy_tilemap
	pop hl
	pop af
	cp $89
	jr z, .quit
	ld a, [wPoncotPicAlignment]
	or a
	jr nz, .quit
	ld e, l
	ld d, h
	ld bc, $7
	add hl, bc
	reg8rot c, l, e
	reg8rot c, h, d
	ld c, $8
.loop2
	push hl
	push de
	ld b, [hl]
	ld a, [de]
